pragma solidity >=0.4.21 <0.6.0;

contract User {

  address[] public activities;

  string public name;
  uint public age;
  uint public weight;
  uint public height;

  constructor(string memory _name, uint _age, uint _weight, uint _height) public  {
    name = _name;
    age = _age;
    weight = _weight;
    height = _height;
  } 

  function getName() public view returns(string memory) {
    return name;
  }

}
